import React from 'react';
import styled from "styled-components";
import {DefaultTextArea} from "../../form/input-fields/primary-textarea";

const Text = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 14px;
line-height: 19px;
color: #444444;
`;



const Title = styled(Text)`
font-weight: bold;
padding-bottom:20px;

`;
const Container = styled("div")`
padding:15px;
border-bottom: 5px solid #EFF2F5;
`;
const FlexContainer = styled("div")`
display:flex;
`;
const CustomDefaultTextArea = styled(DefaultTextArea)`
height:100px;
width:320px;
`;




const Item = () => {
    return (
        <>
            <Container>
                <Title>What do you need?</Title>
                <FlexContainer>
                    <DefaultTextArea/>
                </FlexContainer>
            </Container>
        </>
    );
}

export default Item;
